measurements.description:
Thirty-nine flowers and two buds on five arching to pendulous inflorescences;
	dorsal sepal hooded, yellow heavily ovelaid and blotched dark brown-burgundy;
	lateral sepals lanceolate, yellow, very heavily ovelaid and blotched dark brown-burgundy;
	petals lanceolate, reflexed, yellow very heavily ovelaid and blotched dark brown-burgundy coalescing centrally;
	lip pale yellow, blotched dark burgundy;	

	column light yellow spotted burgundy, overlaid burgundy distally, anther cap cream;


    substance firm; texture matte.
